    false,nt"url": null,nt"notes": "The National Digital Forecast Database
    (NDFD) contains a seamless mosaic of the National Weather Service's (NWS) digital
    forecasts of precipitation probabilities. In collaboration with NWS National Centers
    for Environmental Prediction (NCEP) and NWS Weather Forecast Offices (WFO), the
    central NDFD server ingests 5-km, 2-dimensional grids of precipitation probabilities,
    and creates experimental forecast data mosaics for the coterminous United States
    (CONUS), Alaska, Hawaii, and Guam.",nt"license_title": null,nt"extras":
